import React from 'react';
import '../styles/SearchBox.css';
import { MDBCol, MDBInput } from 'mdbreact';

function SearchBox({ handleSearchChange }) {
	return (
		<MDBCol md="6">
			<MDBInput
				hint="Search"
				type="text"
				containerClass="active-pink active-pink-2 mt-0 mb-3"
			/>
		</MDBCol>
	);
}
export default SearchBox;
